//Model 计算属性
struct Model {
    var name:String
    var code:Int
    var pe:Double
    var pb:Double
    var percent:Double
    
    var industry: String {
        getIndustry(code: code)
    }
    
    var pe_score:Double{
        let newScore = newPePbScore(industry: industry)
        if pe <= 0{
            return 0
        }else if pe < newScore.peScore{
            return  100
        }else{
            return (1 - (pe - newScore.peScore)/newScore.peScore)*100
        }
    }
    
    var pb_score:Double{
        let newScore = newPePbScore(industry: industry)
        if pb < newScore.pbScore{
            return  100
        }else{
            return  (1 - (pb - newScore.pbScore)/newScore.pbScore)*100
        }
    }
    
    var percent_score:Double{
        return 100 * (1-percent)
    }
    
    var total_score:Double{
        return pe_score + pb_score + percent_score
    }
    
