let data = getData()
var array:[Model] = []
array = translateData(rawData: data)

for model in array{
    let newScore = newPePbScore(industry: model.industry)
    print("\(model.name),\(model.pe),\(model.pb),\(model.percent),\(model.code),\(model.industry),\(model.pe_score),\(model.pb_score),\(model.percent_score),\(model.total_score),\(newScore.peScore) \(newScore.pbScore)")
}


